import './App.css';

const App = () => {
  return (
    <>
    <div className='text' id='title'>
      <div>
        <span>Hi</span><span id='aftertitle'>_</span>
      </div>
      <button className="enter-button">
          <img src="imgs/button.webp" alt="Button Icon"></img>
      </button> 
    </div>
    </>
  );
};

export default App;
